column8:
アンパンマンの顔がぬいぐるみみたいに<BR>立体で付いているカワイイスリッパ<BR><BR>
小さなお子様の安全を考え底面の<BR>全面にスベリ止めの点々が付いています。<BR><BR>
アンパンマンの顔はしっかりと取り付けてあるので、<BR>お子様が引っ張っても取れる心配はありません。<BR><BR>
ボタンなどは使用致しておりませんので、<BR>誤飲の心配もありません。<BR><BR>
お子様の足をやさしく包むタオル地。<BR>
甲の裏には、よりソフトな起毛パイルを使用致しております。<BR><BR>


サイズ：16ｃｍくらいまで対応　（外寸約18ｃｍ）<BR>
素材：綿、ポリエステル<BR>
（底面スベリ止め部分）：ＰＶＣ<BR>
やなせたかし/フレーベル館・ＴＭＳ・ＮＴＶ承認済<BR>
生産国：中国<BR>

<br>




